@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@prefix : <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .

:ATM a rdfs:Class .
:Account a rdfs:Class .
:Bank a rdfs:Class .
:CashCard a rdfs:Class .
:Customer a rdfs:Class .

:belongsToBank a rdf:Property ;
  rdfs:domain :ATM ;
  rdfs:range :Bank .

:cardIssuedBy a rdf:Property ;
  rdfs:domain :CashCard ;
  rdfs:range :Bank .

:hasAccount a rdf:Property ;
  rdfs:domain :Customer ;
  rdfs:range :Account .

:ownsCard a rdf:Property ;
  rdfs:domain :Customer ;
  rdfs:range :CashCard .

:valid a rdf:Property ;
  rdfs:domain :CashCard ;
  rdfs:range xsd:boolean .

:serialNumber a rdf:Property ;
  rdfs:domain :CashCard ;
  rdfs:range xsd:string .

:bankCode a rdf:Property ;
  rdfs:domain :CashCard ;
  rdfs:range xsd:string .

:reads a rdf:Property ;
  rdfs:domain :ATM ;
  rdfs:range :CashCard .

[ a owl:Class ;
  owl:equivalentClass [ a owl:Restriction ;
    owl:onProperty :valid ;
    owl:hasValue true ] ;
  rdfs:subClassOf [ a owl:Restriction ;
    owl:onProperty :reads ;
    owl:someValuesFrom [ a owl:Restriction ;
      owl:onProperty :serialNumber ;
      owl:someValuesFrom xsd:string ] ;
    owl:someValuesFrom [ a owl:Restriction ;
      owl:onProperty :bankCode ;
      owl:someValuesFrom xsd:string ] ] ] .
